import Department from "./Department";
import "./List.css";

function List(props) {
  // List has departments

  return (
    <div className="list-component">
      {props.departments.map((department) => (
        <Department
          className="departments"
          name={department.name}
          items={department.items}
        />
      ))}
    </div>
  );
}

